  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes activities and findings
  for a pollution reduction by restoring wetland hydrology and vegetation in Pocosin
  Lakes National Wildlife Refuge. A non-point source pollution reduction project was
  funded in 1994 by the United StatesEnvironmental Protection Agency and administered
  by the North Carolina Division of Water Quality and North Carolina Division of Forest
  Resources. The objective was to reduce nitrogen and mercury loading of downstream
  waters by restoring wetland hydrology and vegetation to a 640-acre research area
  within an 18,000-acre peat bog that was cleared and drained for farming in the 1970's.
  The site became part of Pocosin Lakes National Wildlife Refuge in 1991. In 1995
  an experiment was established in a block near the center of the area targeted for
  wetland restoration. Achieving survival of Atlantic white cedar commensurate with
  that of bald cypress will likely demand additional protection against deer.\",\n\t\"owner_org\":
